      borderTop="1.5px solid #E2E2E2"
      height="240px"
      position="sticky"
      px="20px"
      as="footer"
      backgroundColor="#FFFFFF"
    >
      <Flex
        flexWrap="wrap"
        maxW="1367px"
        mt="45px"
        alignItems={{ sm: "flex-start" }}
        justifyContent="space-around"
        
      >
        
      </Flex>
    </Box>
  );
}
